import React from 'react';
import styles from './SignUpBlock.module.scss'

export const SignIn = () => {
    return (
        <div className={styles.root}>
            <h1>
                <span>
                    SignIn
                </span>
            </h1>
        </div>
    )
}

export default SignIn;
